'use strict';
({ params, imports }) => {
  const programEncounter = params.entity;
  const formElement = params.formElement;
  const _ = imports.lodash;

  let visibility = true;
  let value = null;
  let answersToSkip = [];
  let validationErrors = [];

  // UUID of the height concept (Replace with actual UUID)
  const heightConceptUUID = 'd883d5fe-e17d-4136-b989-089fa0295e34';

  // Retrieve height from "MH Enrolment part-2"
  const previousHeight = new imports.rulesConfig.RuleCondition({ programEncounter, formElement })
    .when.valueInEntireEnrolment(heightConceptUUID)
    .defined
    .matches();

  // If height exists, set it in the "High risk follow-ups" form
  if (previousHeight) {
    value = programEncounter.getValueForConcept(heightConceptUUID);
  }

  return { visibility, value, answersToSkip, validationErrors };
};

'use strict';
({params, imports}) => {
    const programEncounter = params.entity;
    const formElement = params.formElement;
    const _ = imports.lodash;

    let visibility = true;
    let value = null;
    let answersToSkip = [];
    let validationErrors = [];

    // Fetch weight value
    let weightObservation = programEncounter.findObservation('1046e84f-6b02-4e9f-b701-ebefc095acf7');
    let weight = weightObservation ? parseFloat(weightObservation.getReadableValue()) : null;

    // Fetch height value
    let height = programEncounter.programEnrolment.findLatestObservationInEntireEnrolment('d883d5fe-e17d-4136-b989-089fa0295e34');
    let heightInCm = height ? parseFloat(height.getValue()) : null;

    if (weight && heightInCm) {
        // Calculate BMI
        const heightInMeters = heightInCm / 100;
        const bmi = (weight / (heightInMeters * heightInMeters)).toFixed(2);

        // Update the value or show BMI message
        value = bmi;
    } else if (!weight || !heightInCm) {
        validationErrors.push("Please ensure both Weight and Height are entered to calculate BMI.");
    }

    return new imports.rulesConfig.FormElementStatus(formElement.uuid, visibility, value, answersToSkip, validationErrors);
};


