'use strict';
({ params, imports }) => {
  const programEncounter = params.entity;
  const moment = imports.moment;
  const formElement = params.formElement;
  let visibility = true; // Keep the question visible
  let value = null; // Default GA value

  // UUID of "Last Menstrual Period (LMP) Date" from the Enrolment form - 1cc6fd5d-1359-483e-a971-4bf36e34a72d

  // Fetch LMP Date from Entire Enrolment
  const lmpDate = programEncounter.programEnrolment.findLatestObservationInEntireEnrolment('1cc6fd5d-1359-483e-a971-4bf36e34a72d').getValue();

  if (lmpDate) {
    const today = moment(); // Get today's date
    const lmpMoment = moment(lmpDate, "YYYY-MM-DD"); // Convert LMP date to moment object
    const daysDifference = today.diff(lmpMoment, 'days'); // Calculate difference in days
    const gestationalAgeWeeks = Math.floor(daysDifference / 7); // Convert days to weeks

    value = gestationalAgeWeeks; // Set calculated GA
  }

  return new imports.rulesConfig.FormElementStatus(formElement.uuid, visibility, value);
};

